import React from 'react';
import styled from 'styled-components';
import posed, { PoseGroup } from 'react-pose'

const MenuFinderContainer = styled.div`

`;

const menuFinderListPose = {
  enter: {
    opacity: 1,
    delayChildren: 200,
    staggerChildren: 50,
    delay: 3000,
    x: 200,
  },
  exit: {
    opacity: 0,
  }
}

const MenuFinderList = posed.div(menuFinderListPose)

const menuFinderListItemPose = {
  enter: {
    y: 0,
    opacity: 1,
  },
  exit: {
    y: -24,
    opacity: 0,
  }
}

const MenuFinderListItem = styled(posed.div(menuFinderListItemPose))`
  width: 100%;
  padding: 16px;
  box-sizing: border-box;
  background: #fff;
  border-radius: 8px;
  opacity: 0;
`;

const MenuFinderMenu = styled.div`

`;

const MenuFinder = ({ restaurants, handleRestaurantSelect, menu }) => (
  <MenuFinderContainer>
    <PoseGroup>
      {!menu
        ?
        <MenuFinderList key="1">
          Test
        </MenuFinderList>
        :
        null
      }

    </PoseGroup>
  </MenuFinderContainer>
);

export default MenuFinder;
